import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";
import { Facebook, Twitter, Instagram } from "react-feather";

function Navbar(props) {
  let { home, login, sign, social, signText } = props;

  return (
    <div className="navbar-container">
      <div className="navbar-left-items">
        <Link to="/">
          <img
            className="logo-img-blue"
            src="./images/logo-img-blue.png"
            alt="#"
          />
        </Link>
      </div>
      <div className="navbar-mid-items">
        <div className="navbar-buttons">
          {home && (
            <div className="navbar-btn  btn-login">
              <Link className="navbar-link-item" to="/">
                Anasayfa
              </Link>
            </div>
          )}
        </div>
      </div>
      <div className="navbar-right-items">
        <div className="navbar-buttons">
          {login && (
            <div className="navbar-btn  btn-login">
              <Link className="navbar-link-item" to="/login">
                Giri≈ü
              </Link>
            </div>
          )}
          {sign && (
            <div className="navbar-btn  btn-navbar-sign">
              <Link className="navbar-link-item" to="/sign">
                {signText ? signText + "Kaydol" : "Kaydol"} 
              </Link>
            </div>
          )}
          {social && (
            <div className="social-container">
              <Facebook className="icon-social" />
              <Twitter className="icon-social" />
              <Instagram className="icon-social" />
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default Navbar;
